import React from "react";
import { Card } from "react-bootstrap";

const Mobilephoness = (props) => {
  return (
    <>
      <Card
        style={{ width: "13.8rem", border: `none`, marginBottom: `10px` }}
        className="card"
      >
        <Card.Img variant="top" src={props.brand.imgUrl} />
        <Card.Body>
          <Card.Title> {props.brand.name}</Card.Title>
          <Card.Text>
            <p>{props.brand.price}</p>
          </Card.Text>
        </Card.Body>
      </Card>
    </>
  );
};

export default Mobilephones;
